d3.custom = {};
d3.custom.slopegraph = function() {

    var opts = {
        width: window.innerWidth,
        height: 3000,
        labelLength: 200,
        margin: {top: 40, right: 30, bottom: 50, left: 30}
    };

    function exports(selection) {
        selection.each(function (dataset) {
            var chartHeight = opts.height - opts.margin.top - opts.margin.bottom;
            var chartWidth = opts.width - opts.margin.right - opts.margin.left;
            var selected = false;
            var sel_country = "";
            var selected_lines;
            var selectedSide = "None"
            var tooltip = d3.select('body').append('div')
            .attr('class', 'hidden tooltip');

            var parent = d3.select(this);
            parent.on("click", function(d){
                console.log("Selected: "+selected);
                console.log("Country Name: "+sel_country);
                sel_country = "";
                selected = false;
                tooltip.classed('hidden', true)
                chartSvg.selectAll('path.slope-line').data(data)
                .attr("stroke-width", function(d){return d[7]+"px";})
                .attr("visibility","visible");
            });

            var svg = parent.selectAll("svg.chart-root").data([0]);
            svg.enter().append("svg").attr("class", "chart-root")
                    .append('g').attr('class', 'chart-group');
            svg.attr({width: opts.width, height: opts.height});
            svg.attr("align","center");
            svg.exit().remove();

            var chartSvg = svg.select('.chart-group');
            var data = dataset.data;
// scales for visualisation
            var temp = dataset.label_position[0][dataset.label_position[0].length-1]
            var scale = d3.scale.linear().domain([0,87]).range([0, chartHeight-temp]);
            var linescale = d3.scale.log().base(10).domain([1,945654]).range([3,30]);
            var scale2 = d3.scale.linear().domain([1,88]).range([0, chartHeight-temp]);
            var scale3 = d3.scale.linear().domain([1,88]).range([0, chartHeight-temp]);
            var lineColour = d3.scale.linear().domain([1,88]).interpolate(d3.interpolateHcl).range([d3.rgb("#007AFF"), d3.rgb('#FFF500')]);
            console.log(data)
            
            var lines = chartSvg.selectAll('path.slope-line')
            .data(data);
            lines.enter().append("path");
            lines.attr({class:'slope-line',
            'origin':function(d){return dataset.label[0][d[0]];},
            'asylum':function(d){return dataset.label[1][d[1]];}
            });
            lines.attr('d', function(d){
                var start_x = opts.margin.left + opts.labelLength*1.5;
                var start_y = opts.margin.top + scale(d[0]) + d[5] - d[3] + (d[7]/2);
                var end_x = opts.width - opts.margin.right - opts.labelLength*1.5;
                var end_y = opts.margin.top + scale(d[1]) + d[6] - d[4] + (d[7]/2);
                return "M" + start_x + "," + start_y
                + " C" + (start_x + (end_x - start_x)/4) + "," + start_y
                + " " + (start_x + 3*((end_x - start_x)/4)) + ","+ end_y
                + " " + end_x + "," + end_y;
            });
            lines.attr("stroke-opacity",0.4);
            lines.attr("stroke-width", function(d){return d[7]+"px";});
            lines.attr("stroke", function(d){return lineColour(d[0]);});
            lines.on('mousemove', function(d) {
                var index = 1;
                var total = 0;
                if(selectedSide == "Left"){
                    total = dataset.total_Movement[0][d[0]]
                    index = 0;
                } else {
                    index = 1;
                    total = dataset.total_Movement[1][d[1]]
                }
                var country_name = dataset.label[index][d[index]];
                if (selected == true && sel_country==country_name){
                    var mouse = d3.mouse(svg.node()).map(function(d) {
                        return parseInt(d);
                    });
                    tooltip.classed('hidden', false)
                        .attr('style', 'left:' + (mouse[0]+30) +
                                'px; top:' + (mouse[1]+100) + 'px')
                        .html("<div>"+d[2]+" out of "+total+" refugees</div>");
                }
                });

/// LEFT LABELS
            var left_pos_data = dataset.position[0];

            var leftLabels = chartSvg.selectAll('text.left_labels')
                .data(left_pos_data);
            leftLabels.enter().append('text');
            leftLabels.attr({
                    class: 'left_labels slope-label',
                    x: opts.margin.left + opts.labelLength*1.5 -5,
                    y: function(d,i) { return opts.margin.top + scale3(d) + (dataset.label_position[0][i]) - (dataset.label_width[0][i]/2);  },
                    dy: '.35em',
                    'text-anchor': 'end',
                    'name': function(d,i){return dataset.label[0][i]}})
                .text(function(d,i) { return dataset.label[0][i] }).style("font-size","14px");
            leftLabels.on("mouseenter",function(d) {
                var lineMouseOver = this;
                var country_name = dataset.label[0][d-1];
                var selectedgroup = d3.selectAll('[origin="'+country_name+'"]');
                var deselectedGroup = d3.selectAll("path.slope-line").filter(function(d){ return d3.select(this).attr("origin") !== d3.select(lineMouseOver).attr("name");});
                console.log(deselectedGroup)
                selectedgroup.attr('visibility',"visible");
                deselectedGroup.attr("visibility","hidden");//deselectedGroup.remove();
                selected = true;
                sel_country = country_name;
                selectedSide = "Left";
            });
// Left country line sections
            var leftDividers = chartSvg.selectAll('path.left_label_bars')
            .data(left_pos_data);
            leftDividers.enter().append('path');
            leftDividers.attr('d', function(d,i){
                var start_x = opts.margin.left + opts.labelLength*1.5;
                var start_y = opts.margin.top + scale3(d) + (dataset.label_position[0][i]) - (dataset.label_width[0][i]);;
                var end_x = opts.margin.left + opts.labelLength*1.5;
                var end_y = start_y + dataset.label_width[0][i];
                return "M" + start_x + "," + start_y + " L" + end_x+ "," + end_y;
            });
            leftDividers.attr("stroke-opacity",1);
            leftDividers.attr("stroke-width", "3px");
            leftDividers.attr("stroke","green");
            leftDividers.attr({class:'left_label_bars',
            'type': "Divider"
            });

/// RIGHT LABELS
            var right_pos_data = dataset.position[1];

            var rightLabels = chartSvg.selectAll('text.right_labels')
                .data(right_pos_data);
            rightLabels.enter().append('text');
            rightLabels.attr({
                    class: 'right_labels slope-label',
                    x: opts.width - opts.margin.right - opts.labelLength*1.5+5,
                    y: function(d,i) { return opts.margin.top + scale2(d) + (dataset.label_position[1][i]) - (dataset.label_width[1][i]/2); },
                    dy: '.35em',
                    'name': function(d,i){return dataset.label[1][i]}
                })
                .text(function(d,i) { return dataset.label[1][i] }).style("font-size","14px");
            rightLabels.on("mouseenter",function(d) {
                var country_name = dataset.label[1][d-1];
                var lineMouseOver = this;
                var selectedgroup = d3.selectAll('[asylum="'+country_name+'"]');
                var deselectedGroup = d3.selectAll("path.slope-line").filter(function(d){ return d3.select(this).attr("asylum") !== d3.select(lineMouseOver).attr("name");});
                console.log(deselectedGroup);
                selectedgroup.attr('visibility',"visible");
                deselectedGroup.attr("visibility","hidden");
                selected = true;
                sel_country = country_name;
                selectedSide = "Right";
            });
// Right country line sections
            var rightDividers = chartSvg.selectAll('path.right_label_bars')
            .data(right_pos_data);
            rightDividers.enter().append('path');
            rightDividers.attr('d', function(d,i){
                var start_x = opts.width - opts.margin.right - opts.labelLength*1.5;
                var start_y = opts.margin.top + scale2(d) + (dataset.label_position[1][i]) - (dataset.label_width[1][i]);;
                var end_x = opts.width - opts.margin.right - opts.labelLength*1.5;
                var end_y = start_y + dataset.label_width[1][i];
                return "M" + start_x + "," + start_y + " L" + end_x+ "," + end_y;
            });
            rightDividers.attr("stroke-opacity",1);
            rightDividers.attr("stroke-width", "3px");
            rightDividers.attr("stroke","green");

// Country title
            svg.append('foreignObject')
                .attr('x', opts.width - (opts.margin.right*3) - opts.labelLength)
                .attr('y', 0)
                .attr('width', 60)
                .attr('height', 10)
                .append("xhtml:body")
            .html('<div style="width: 60px; color: white;"><strong>Asylum</strong></div>')
            .style("font-family","verdana");

            svg.append('foreignObject')
                .attr('x', opts.labelLength*2 - (opts.width - svg.select("g").node().getBBox().width))
                .attr('y', 0)
                .attr('width', 20)
                .attr('height', 10)
                .append("xhtml:body")
            .html('<div style="width: 20px; color: white;"><strong>Origin</strong></div>')
            .style("font-family","verdana");

            lines.exit().remove();
            leftLabels.exit().remove();
            rightLabels.exit().remove();
            leftDividers.exit().remove();
            rightDividers.exit().remove();
        });
    }


    exports.opts = opts;
    createAccessors(exports);

    return exports;
}


createAccessors = function(visExport) {
    for (var n in visExport.opts) {
        if (!visExport.opts.hasOwnProperty(n)) continue;
        visExport[n] = (function(n) {
            return function(v) {
                return arguments.length ? (visExport.opts[n] = v, this) : visExport.opts[n];
            }
        })(n);
    }
};


